// App.js

// Importuje potrzebne moduły z React i react-router-dom
import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

// Importuje komponenty stron z odpowiadającymi nazwami plików
import OsobaList from './components/OsobaList';

// Główny komponent aplikacji
function App() {
    return (
        // Router otaczający całą aplikację, dostarczający kontekst routingu
        <Router>
            {/* Definicje tras */}
            <Route path="/" exact component={OsobaList} /> {/* Strona główna */}
        </Router>
    );
}

// Eksportuje komponent App jako domyślny
export default App;
